import React, { useEffect } from 'react'
import { useGlobalContext } from '../../context/globalContext';
import styled from 'styled-components';
import HistoryExpenses from '../../History/HistoryExpenses'

function Transactions() {
    const {totalExpenses,incomes, expenses, totalIncome, totalBalance, getIncomes, getExpenses, incomeHistory, expenseHistory } = useGlobalContext()

    useEffect(() => {
        getExpenses()
    }, [])

    return (
        <TransactionsStyled>
            <h1>All transactions</h1>
            <div className="stats-con">
                <HistoryExpenses></HistoryExpenses>
            </div>
        </TransactionsStyled>
    )
}

const TransactionsStyled = styled.div`
    .stats-con{
        display: grid;
        grid-template-columns: repeat(5, 1fr);
        gap: 2rem;

`;

export default Transactions
